import React from "react";

import { Parallax, Background } from "react-parallax";
import cu from "../../3_images/2_theInitiative/bg_initiative-banner.jpg";

//COMPONENTS
import Line from "../2_module/Line";
import BackgroundImg from "./BackgroundImg";

//STYLES
import { HeaderStyle } from "../../2_styles/1_layout/HeaderStyle";
import { BackgroundImgStyle } from "../../2_styles/1_layout/BackgroundImgStyle";

export default function Header({ bgImg, title, subtitle }) {
  return (
    <div>
      <HeaderStyle>
        {/* <BackgroundImg
          bgImg={bgImg}
          height="100vh"
          zIndexImg="-4"
          zIndexImgShadow="-3"
        /> */}
        <BackgroundImgStyle>
          <Parallax strength={300}>
            <div>Use the background component for custom elements</div>
            <Background className="custom-bg">
              <img
                src="../../3_images/2_theInitiative/bg_initiative-banner.jpg"
                alt="fill murray"
              />
            </Background>
          </Parallax>
        </BackgroundImgStyle>

        <div className="title">
          <p>the</p>
          <p>{title}</p>
          <Line />
          <p>{subtitle}</p>
        </div>
      </HeaderStyle>
    </div>
  );
}
